column8:
バイク業界初の日本製LEDヘッドライト<br>
<br>
LEDの輝きが新たな走りのステージを演出。<br>
RIZING＜ライジング＞はスフィアライトLED製品の最上位シリーズ。<br>
国内開発にこだわり、最高品質を目指した製品です。<br>
<br>
・独自配光設計による圧倒的な明るさ<br>
・ファンレスヒートシンク・アノダイジング加工による品質持続<br>
・省電力設計によるバッテリートラブルの回避<br>
・球切れの心配が要らない長寿命<br><br>
<br>
<img src="http://image.rakuten.co.jp/ainekusu/cabinet/02994387/04626268/imgrc0068724685.jpg">
<br><br>
仕様<br>
ルーメン: 2700lm<br>
消費電力: 20W<br>
動作電圧: 直流DC12V<br>
製品寿命: 30000時間<br>
カラー: 5500K（ウォームホワイト）<br>
<br>
セット内容<br>
・LEDバルブ × 1<br>
・コントローラー × 1<br>
・六角レンチ × 1<br>
・結束バンド × 2<br>
・取扱説明書（保証書） × 1<br>
